import { faCalendarDays  } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
function SelectPage() {
  
    return (
      <div>
        <div className='left'>
        <FontAwesomeIcon icon={faCalendarDays} />
        </div>
        <div className='right'>

        </div>
      </div>
    );
  }
  export default SelectPage;
